import React, { useState } from 'react';
import { NavLink, Outlet, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import {
  FaBars,
  FaTimes,
  FaHome,
  FaBox,
  FaList,
  FaTree,
  FaCalendar,
  FaEnvelope,
  FaCog,
  FaSignOutAlt,
  FaUser
} from 'react-icons/fa';

const Layout = () => {
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const menuItems = [
    { path: '/dashboard', icon: FaHome, label: 'Dashboard' },
    { path: '/packages', icon: FaBox, label: 'Packages' },
    { path: '/categories', icon: FaList, label: 'Categories' },
    { path: '/parks', icon: FaTree, label: 'Parks' },
    { path: '/bookings', icon: FaCalendar, label: 'Bookings' },
    { path: '/enquiries', icon: FaEnvelope, label: 'Enquiries' },
    { path: '/settings', icon: FaCog, label: 'Settings' },
  ];

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Sidebar */}
      <div
        className={`fixed inset-y-0 left-0 z-30 w-64 bg-white shadow-lg transform transition-transform duration-300 ease-in-out ${
          sidebarOpen ? 'translate-x-0' : '-translate-x-full'
        } lg:translate-x-0 lg:static lg:inset-0`}
      >
        <div className="flex items-center justify-between h-16 px-4 border-b border-gray-200">
          <div className="flex items-center">
            <img
              src="/logo.png"
              alt="Logo"
              className="h-8 w-auto"
            />
            <span className="ml-2 text-xl font-semibold text-gray-800">
              Safari Admin
            </span>
          </div>
          <button
            onClick={() => setSidebarOpen(false)}
            className="lg:hidden text-gray-500 hover:text-gray-600"
          >
            <FaTimes className="h-6 w-6" />
          </button>
        </div>

        <nav className="mt-5 px-2">
          <div className="space-y-1">
            {menuItems.map((item) => (
              <NavLink
                key={item.path}
                to={item.path}
                className={({ isActive }) =>
                  `flex items-center px-4 py-2 text-sm font-medium rounded-md transition-colors duration-150 ease-in-out ${
                    isActive
                      ? 'bg-primary-50 text-primary-700'
                      : 'text-gray-600 hover:bg-gray-50 hover:text-gray-900'
                  }`
                }
              >
                <item.icon className="mr-3 h-5 w-5" />
                {item.label}
              </NavLink>
            ))}
          </div>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 min-w-0 flex flex-col lg:pl-64">
        {/* Top Navigation */}
        <div className="sticky top-0 z-20 flex items-center justify-between h-16 px-4 bg-white border-b border-gray-200">
          <button
            onClick={() => setSidebarOpen(true)}
            className="lg:hidden text-gray-500 hover:text-gray-600"
          >
            <FaBars className="h-6 w-6" />
          </button>

          <div className="flex items-center ml-auto">
            <div className="flex items-center">
              <div className="relative">
                <div className="flex items-center">
                  <FaUser className="h-5 w-5 text-gray-400" />
                  <span className="ml-2 text-sm font-medium text-gray-700">
                    {user?.name || 'User'}
                  </span>
                </div>
              </div>
              <button
                onClick={handleLogout}
                className="ml-4 flex items-center text-sm font-medium text-gray-500 hover:text-gray-700"
              >
                <FaSignOutAlt className="mr-2 h-5 w-5" />
                Logout
              </button>
            </div>
          </div>
        </div>

        {/* Page Content */}
        <main className="flex-1 overflow-y-auto">
          <Outlet />
        </main>
      </div>
    </div>
  );
};

export default Layout;
